    fn f(l: &[i64]) -> [i64; 4] {
        let mut l_inner = [0, 0, 0, 0];
        l_inner[0] = l[0];
        l_inner
    }
    let mut l = [1, 0, 0, 0];
    l = f(&l);
    println!("{:?}", l);
}
